import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { setFirstName } from './redux/mySlice/mySlice';

export default function ChildComponent() {
    const dispatch = useDispatch();

    return (
        <div>
            <input type="text" onChange={event => dispatch(setFirstName(event.target.value))} placeholder='first name' />
            <input type="text" placeholder='last name' />
            <p>First name:</p>
            <p>Last name:</p>
        </div>
    )
}
